            var site_url = 'https://s-qn7s53yswhc7.eu1.wpsandbox.org';
            var qs_expired_site_landing_page_url = '';
            var time_diff = parseInt( exp_time ) - parseInt( time_now );
            var timeout_qq;
            var countdown_element;

            function qs_core_demo_countdown_tick() {
                var hours   = parseInt( time_diff / 3600, 10 );
                var minutes = parseInt( ( time_diff / 60 ) % 60, 10 );
                var seconds = parseInt( time_diff % 60, 10 );
                countdown_element = document.getElementById( 'qs_core_demo_countdown_tick');
                countdown_element = countdown_element || document.createElement('span');

                var clock_content = qs_core_demo_countdown_seconds_to_hr(time_diff);

                if ( exp_time == -1 ) {
                    time_diff = 0;
